import React from "react"
import PropTypes from "prop-types"

function Food({ name, price, rating}){ // same with Food({ fav })
  return(
    <div>
      <h2>I love { name } which is { price }</h2>
      <h3>rating: { rating } out of 10</h3>
    </div>
  )
}

Food.propTypes = {
  name: PropTypes.string.isRequired,
  price: PropTypes.string.isRequired,
  rating: PropTypes.string.isRequired
};
const foodILike = [
  {id: 1, name: "kimchi", price: "$4", rating: 3},
  {id: 2, name: "pizza", price: "$11", rating: 2},
  {id: 3, name: "ramen", price: "$15", rating: 4.4},
  {id: 4, name: "burger", price: "$9", rating: 1},
  {id: 5, name: "icecream", price: "$2", rating: 7.3}
]

function renderFood(dish){
  console.log(dish);
  return <Food key={dish.id} name={dish.name} price={dish.price}/>
}
function App() {
  return (
    <div className="App">
      {foodILike.map(dish => (
        <Food key={dish.id} name={dish.name} price={dish.price} rating={dish.rating}/>
      ))}
    </div>
  );
}

export default App;
